precision highp float;

const float PI = 3.14;
const float e = 2.71;
const float R = e/PI;


void mainImage( out vec4 O, in vec2 u )
{
    vec2 uv = ( 2. * u - iResolution.xy ) / iResolution.y;
    float m = smoothstep(0., R, (-length(uv) + R)/.03) - smoothstep(0., R/1.1, (-length(uv - vec2(0., R/2.)) + R/1.1)/.03); 
    O = vec4(m);
}
